Below is a sample script that makes use of the Airflow API. This script does the following: Initializes the Airflow API client using authentication details from environment variables. Fetches a list of all DAGs from the Airflow API. Prints a sorted list of DAG IDs for better readability. Triggers a new DAG run for a specified DAG using the API. Updates an Airflow dataset using the API. Handles API errors and retries requests if necessary. # airflow_api_call.pyimport requestsimport osimport jsonfrom dotenv import load_dotenvload_dotenv()API_URL = os.getenv("AIRFLOW_API_URL")API_KEY = os.getenv("DATACOVES_API_KEY")def update_dataset(name): url=f"{API_URL}/datasets/events" response = requests.post( url=url, headers = { "Authorization": f"Token {API_KEY}", }, json={"dataset_uri": "upstream_data",} ) return response.json()def trigger_dag(dag_id): url=f"{API_URL}/dags/{dag_id}/dagRuns" response = requests.post( url=url, headers = { "Authorization": f"Token {API_KEY}", }, json={"note": "Trigger from API",} ) return response.json()def list_dags(): url=f"{API_URL}/dags" response = requests.get( url=url, headers = { "Authorization": f"Token {API_KEY}", "Content-Type": "application/json", }, ) # Extract just the DAG names from the response dags_data = response.json() dag_names = [dag['dag_id'] for dag in dags_data['dags']] # Sort the names alphabetically for better readability dag_names.sort() return dag_namesdef print_response(response): if response: msg = json.dumps(response, indent=2) print(f"Event posted successfully:
